import React from "react";

export const Moods = ({ mood }) => {
  const env = process.env;
  env.PUBLIC_URL = env.PUBLIC_URL || "";

  return (
    <img
      classname="mood-img"
      src={process.env.PUBLIC_URL + `/assets/emotion${mood}.png`}
    />
  );
};
